import HeaderBar from "@components/header"
import { useHistory } from "react-router-dom";
import { Picker, List, Toast } from "antd-mobile"
import './style.scss'
const OffTimer = () => {
   const { goBack } = useHistory();
   return (
      <ul className="task-wrap">
         {
            [1, 2, 3, 4, 5, 6, 7].map(item => {
               return (
                  <>
                     <li className="timers-item">
                        <p>订单号:111111111111111</p>
                        <div className="task-bottom">
                           <div className="left">
                              <i className="def-bank-icon"></i>
                           </div>
                           <div className="min">
                              <span>¥1890.00</span>
                              <span>任务奖励:<i></i>29.00</span>
                           </div>
                           <div className="right">
                              <span></span>
                              <span>提交超时锁定</span>
                           </div>
                        </div>
                     </li>
                  </>
               )
            })
         }
      </ul>

   )
}
export default OffTimer;
